function ListGroup() {
  const patterns = ["tua madre", "tua zia", "tua cugina", "tua sorella"];

  patterns.map((pattern) => <li>patterns</li>);

  return (
    <>
      <h1>List</h1>
      <ul className="list-group">
        {patterns.map((pattern) => (
          <li>patterns</li>
        ))}
      </ul>
    </>
  );
}

export default ListGroup;
